   this[database_length++] = new SearchPage("prijateljske-utakmice.html", "Vijesti", "        Vijesti                                                 Naslovna &gt  Vijesti            Košarkaši Rudeša odigrali su prve dvije prijateljske utakmice u sklopu priprema za nadolazeću sezonu.Prva utakmica odigrana je protiv Premier ligaša Hermes Analitice Utakmica je bila zatvorenog tipa te se nijebrojao rezultat Rudeš je nastupio u nepotpunom sastavu bez Juriča, Kučana i Cvitkovića pa su neki drugi igrači dobi priliku da pokažu šta znaju.Obje momčadi su u ranim fazama priprema tako da treneri još uvijek isprobavaju igrače na raznim pozicijama, tako da ne trebaju čuditi pogreške na obje strane.Druga utakmica je odigrana u Zaboku protiv istoimenog domaćina Rudeš je ponovo igrao u kombiniranom sastavu i ovoga puta utakmica je bila otvorena za javnost.Rudeš je ponovo odigrao u nekim dionicama dobro a u nekim jako loše što ne čudi jer su noge i ruke još uvijek teške od napornih uvodnih priprema.Dojma smo kad se priključe svi igrači da će Rudeš igrati puno bolje i da će rasti iz utakmice u utakmicu.ZABOK – RUDEŠ&nbsp &nbsp  104 78&nbsp   27 17, 24 20, 33 16, 20 23 Zabok  Torić 7, Bynum 15, Martinko, Kalpić 8, Kapusta 5, Vlaić 9, Črnjević 14, Ćutuk 11, Vučić 10, Tuđen 5, Vrlika 14, Jambrović 6 Trener  I.PerinčićRudeš  Radman 19, Zebić 2, Tikvić, Šuvak, Galić 9, Štirjan 12, Jurković 10, Nakić 7, Dmitrović, Ljubičić 13, Rossi, Meštrović 6 Trener  M.Ličina        NASLOVNA    SENIORI    JUNIORI    MLADI    MLA&#272 I&nbsp KADETI    KADETI        &#352 KOLA&nbsp KO&#352 ARKE    MINI&nbsp KO&#352 ARKA    SPORTSKE&nbsp &#352 KOLE        MEDIA    FOTO  VIDEO      O&nbsp KLUBU    KONTAKT    POVIJEST                                                                                     ", "");
