   this[database_length++] = new SearchPage("treneri-mk.html", "Vijesti", "        Vijesti                                                 Naslovna &gt  Vijesti            Robert Kovačev novo je lice u Košarkaškom klubu Rudeš Uz Edina Hadžića, koji je već neko vrijeme u klubu, biti će voditelji projekta za najmlađe uzraste.Radi se o vrhunskim trenerima koji će svojim znanjem i iskustvom uveliko pomoći razvoju škole košarke i mlađih selekcija u kojoj je Rudeš jedan od lidera.Robert Kovačev iskusan je stručnjak za mlađe kategorije koji je u karjeri vodio mlađe selekcije KK Zrinjevca, KK Zagreba i KK Cedevite.Odgojio je i vodio mnoštvo igrača koji su kasnije otišli u velike klubove Edin Hadžić također je iskusan trener koji je u karijeri prošao sve stepenice, od vrhunske košarke do rada sa mladim igračima Nema druge nego da im poželimo sreću i puno uspjeha u radu         NASLOVNA    SENIORI    JUNIORI    MLADI    MLA&#272 I&nbsp KADETI    KADETI        &#352 KOLA&nbsp KO&#352 ARKE    MINI&nbsp KO&#352 ARKA    SPORTSKE&nbsp &#352 KOLE        MEDIA    FOTO  VIDEO      O&nbsp KLUBU    KONTAKT    POVIJEST                                                                                     ", "");
