   this[database_length++] = new SearchPage("pripreme-seniori.html", "Vijesti", "        Vijesti                                                 Naslovna &gt  Vijesti            Zagrebački Rudeš je među prvim klubovima koji je krenuo u pripreme za A-1 ligu Na prvoj prozivci trenerima Ličini i Smiljaniću odazvalo se 18 igrača Radi se punom parom pod budnim okom našeg vrhunskog stručnjaka za fizičku pripremu Igora Blažinčića, koji već nekoliko godina brine o fizičkoj spremi kompletnog pogona KK Rudeš Naknadno će se još priključiti Mato Meštrović i Marino Kučan koji su opravdali svoje izostanke.Sa Rudešom treniraju Damir Mijić te Mateo Jurković koji će također biti u konkurenciji za popunu mjesta u prvome timu.U prvim tjednima Rudeš će raditi puno na tjelesnoj spremi te će nakon toga krenuti sa pripremnim utakmicama Svi igrači maksimalno su krenuli sa radom jer ove godine konkurencija je velika te se svi žele nametnuti trenerima Ličini i Smiljaniću        NASLOVNA    SENIORI    JUNIORI    MLADI    MLA&#272 I&nbsp KADETI    KADETI        &#352 KOLA&nbsp KO&#352 ARKE    MINI&nbsp KO&#352 ARKA    SPORTSKE&nbsp &#352 KOLE        MEDIA    FOTO  VIDEO      O&nbsp KLUBU    KONTAKT    POVIJEST                                                                                         ", "");
   this[database_length++] = new SearchPage("dijagnostika-seniori.html", "Vijesti", "        Vijesti                                                 Naslovna &gt  Vijesti            Košarkaši Rudeša treniraju pod paskom vrhunskog stručnjaka za fizičku pripremu Igora Blažinčića koji im je omogućio da u prvome tjednu prođu najsuvremenije testove.Radi se o Opto Gait i Witty SEM dijagnostičkoj opremi za testiranje motoričkih i kognitivnih sposobnosti sportaša.Testira se agilnost, snaga, reaktibilnost, koordinacija, dinamički balans i brzina kod naših košarkaša.Testiranje je temelj za planiranje i programiranje kvalitetnog trenažnog programa, sa ciljem smanjenja ozljeda, ispravljanjem loših tehnika izvedbe motoričkih sposobnosti i ekonomiziranjem funkcionalnih sposobnosti        NASLOVNA    SENIORI    JUNIORI    MLADI    MLA&#272 I&nbsp KADETI    KADETI        &#352 KOLA&nbsp KO&#352 ARKE    MINI&nbsp KO&#352 ARKA    SPORTSKE&nbsp &#352 KOLE        MEDIA    FOTO  VIDEO      O&nbsp KLUBU    KONTAKT    POVIJEST                                                                                      To će uvelike pomoći svakom igraču da kroz individualne treninge popravi svaki segment svoje igre.Isto tako Rudeš ovakvim treninzima prati svijetske trendove te je prvi košarkaški klub u Hrvatskoj koji je svoje igrače testirao na ovakvoj opremi.Još jednom hvala Igoru Blažinčiću što je omogućio Rudešu da se sprema po najvišim svijetskim standardima te se nadamo da će im to biti od velike pomoći&nbsp  kad krene sezona           ", "");
