   this[database_length++] = new SearchPage("rudes-bosco-int.html", "Vijesti", "        Vijesti                                                 Naslovna &gt  Vijesti            Košarkaši Rudeša nakon zimske pauze nastavljaju prvenstvo domaćom utakmicom protiv Bosca.Kakvo je stanje u momčadi i kako su trenirali preko praznika upitali smo trenera prve momčadi Milana Ličinu - iskoristili smo ovu pauzu za mini pripreme i moram reći da sam izrazito zadovoljan angažmanom i zalaganjem svih igrača Treniralo se dva puta na dan s time da se u jutro treniralo u Fitness studiju Body&amp Mind pod paskom vrhunskih stručnjaka Igora i Mirele, sa kojima smo uspostavili odličnu suradnju, a navečer se radilo u dvorani.Osim par igrača koji su dobili slobodno zbog blagdana ostali su svi bili uključeni u program.Priključili smo i par mlađih igrača  juniora  koji su svojom željom i zalaganjem još više pridonijeli intenzitetu treninga.Sad nam predstoje 3 jako teške i bitne utakmice koje će nam pokazati smjernice i plan rada u drugom dijelu prvenstva.Dali ste se posebno pripremali za Bosco?- Bosco poznajemo jako dobro i znamo da su nosioci ekipe igrači Cibone na posudbi Mi vjerujemo u našu kvalitetu i energiju koje nose naši mladi igrači i uz određenu dozu sreće nadamo se pozitivnom rezultatu.Kakve su vaše prognoze za prva 3 kola u nastavku?- Nakon Bosca imamo teško gostovanje u Splitu protiv Universitasa i onda igramo doma s Karlovcem.To su tri vrlo teške i zahtjevne utakmice koje nose svoje draži i gdje su svi ishodi mogući.Međutim nećemo ići toliko daleko i idemo pripremati i igrati utakmicu po utakmicu.Dali je bilo kakvih promjena u rosteru prve momčadi?- Napustio nas je Vedran Morović i to su sve promjene koje su se desile Marino Kučan nažalost još nije počeo sa treninzima zbog zdravstvenih problema i on će nam najviše nedostajati ali opet kažem naš roster je ogroman i svaki igrač bio on kadet, junior ili senior može uskočiti i pridonijeti igri svoje momčadi.Znači u subotu 13.01 dvorana Sutinska Vrela sa početkom u 18 30 Rudeš ugošćuje Bosco u 9 kolu 1 Hrvatske košarkaške lige.Ajmo Rudeš!        NASLOVNA    SENIORI    JUNIORI    MLADI    MLA&#272 I&nbsp KADETI    KADETI        &#352 KOLA&nbsp KO&#352 ARKE    MINI&nbsp KO&#352 ARKA    SPORTSKE&nbsp &#352 KOLE        MEDIA    FOTO  VIDEO      O&nbsp KLUBU    KONTAKT    POVIJEST                                                                                     ", "");
