   this[database_length++] = new SearchPage("video.html", "Video Galerija", "        Video Galerija                                                   Naslovna &gt  Vijesti &gt  Seniori &gt  Mlađi kadeti &gt  Kadeti &gt  Juniori &gt  Mini košarka &gt  Foto &gt  Video            NASLOVNA      VIJESTI      SENIORI      MLADI    MLA&#272 I&nbsp KADETI    KADETI    JUNIORI          &#352 KOLA&nbsp KO&#352 ARKE      MINI&nbsp BASKET    SPORTSKE&nbsp &#352 KOLE        KONTAKT              Izbornik                NASLOVNA    SENIORI    JUNIORI    MLADI    MLA&#272 I&nbsp KADETI    KADETI        &#352 KOLA&nbsp KO&#352 ARKE    MINI&nbsp KO&#352 ARKA    SPORTSKE&nbsp &#352 KOLE        MEDIA    FOTO  VIDEO      O&nbsp KLUBU    KONTAKT    POVIJEST                                                                                               ", "");
   this[database_length++] = new SearchPage("povijest.html", "Povijest", "        Povijest                                                 Naslovna &gt  Vijesti &gt  Seniori &gt  Mlađi kadeti &gt  Kadeti &gt  Juniori &gt  Mini košarka &gt  Foto &gt  Video &gt  Kontakt &gt  Povijest            NASLOVNA      VIJESTI      SENIORI      MLADI    MLA&#272 I&nbsp KADETI    KADETI    JUNIORI          &#352 KOLA&nbsp KO&#352 ARKE      MINI&nbsp BASKET    SPORTSKE&nbsp &#352 KOLE          FOTO            Izbornik            O KlubuKK Rudeš djeluje u zapadnom dijelu grada Zagreba i svojom aktivnošću obuhvaća naselja Rudeš, Vrbani, Prečko, Špansko, Jarun, Voltino, Ljubljanicu i šire.Osnovani smo davne 1972 godine inicijativom košarkaških entuzijasta iz naselja Rudeš i počeli se takmičiti u nižerazrednim ligama u organizaciji KSZ-a Dugogodišnjom animacijom košarkaškog sporta u KK Rudeš, kroz koji je prošao velik broj kvalitetnih igrača, uspjeli smo se izboriti za natjecanje u A-2 ligi i postati stabilan Klub drugoligaškog natjecanja u organizaciji KSH-a.Dolaskom nove Uprave 2008 godine posvetili smo posebnu pozornost na mlađe dobne uzraste i u vrlo kratkom vremenu postali smo jedan od respektabilnijih klubova u radu s djecom i mladeži, kako u športskom tako i u sociološkom i pedagoškom smislu.KK Rudeš ima u svom pogonu više od 200 djece predškolskog i školskog uzrasta koji se natječu u svim ligama u organizaciji KSZ-a i KSH-a kroz selekcije mini košarke, mlađih kadeta, kadeta, juniora i seniora.Posebno smo ponosni što smo osnovali mini košarkašku ligu Rudeš, koja iz godine u godinu ima sve više polaznika i sudionika mlađeg školskog uzrasta, a igra se na mini koševima uz pozornost trenera&nbsp  iz čega selektivno proizlaze igrači za vlastiti kadar u Klubu.Dolaskom gosp Nevena Spahije našeg vrhunskog trenera za potpredsjednika Kluba, naš projekt razvoja košarke u zapadnom dijelu grada Zagreba i šire, dobiva na značenju iz razloga što je naš vrsni košarkaški stručnjak prepoznao rad s mlađim dobnim uzrastima i odlučio pomoći svojim znanjem i iskustvom u organizaciji Kluba, u edukaciji trenera i športskom usavršavanju mlađih dobnih uzrasta u Klubu        NASLOVNA    SENIORI    JUNIORI    MLADI    MLA&#272 I&nbsp KADETI    KADETI        &#352 KOLA&nbsp KO&#352 ARKE    MINI&nbsp KO&#352 ARKA    SPORTSKE&nbsp &#352 KOLE        MEDIA    FOTO    VIDEO      O&nbsp KLUBU    KONTAKT    POVIJEST                                                                             ", "");
